import React from "react";
import gyratIMG from '../images/GyrationHopScreenshot.png'

const Home = () => {
    return(
        <div className={'container p-4'}>
            <div className={'card m-4'}>
                <div className={'col p-2'}>
                    <h1>NAME</h1>
                </div>
                <div className={'col'}>
                    <img src={gyratIMG} alt={'GyrationHop'}/>
                    <h1>PICTURE</h1>
                </div>
            </div>
        </div>
    );
}

export default Home;
